import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
    return (
        <div className="container">
            <div className="row">
                <div className="col">
                    <h2>Home</h2>
                    <Link to="/login" className="btn btn-primary">Go to Login</Link>
                </div>
            </div>
        </div>
    );
}

export default Home;
